import React from 'react'
import Global from './components/global';
import { Route, Router, Routes } from 'react-router-dom';



import './App.css';


const App = () => {
  return (
    <Router>
      <Routes>
        <Route to="" element={ <Global />}></Route>

      </Routes>
    </Router>


  )
}

export default App
